import React, { Component } from "react";
import "./MickeyCard.css";

const Card = props => {
  <div className="card">
    <div className="img-container">
      <img
        src={props.image}
        alt="-mickey-character"
        onClick={this.props.click}
      />
    </div>
  </div>;
};

export default Card;
